import "./Css_Styles/Registro_styles.css";
import React, { useState } from 'react';
import { useDispatch } from 'react-redux'; 
import RegistroIMG from './Imagenes/RegistroIMG.png';
import { useForm } from "../../hooks/useForm";
import { registerAuth } from "../store/slices/auth/Thunks";


const Registro = () => {
  const dispatch = useDispatch(); 
  const { values, handleChange } = useForm({ username: '', email: '', password: '', password2: '' }); 
  const [registrationMessage, setRegistrationMessage] = useState(null);
  // Asegurarse de que values esté definido antes de desestructurarlo
  const { username, email, password, password2 } = values || {}; 

  const onInputChange = (event) => {
    handleChange(event); 
  };

  const handleRegister = async () => {
    // Validar campos aquí si es necesario
    if (!username || !email || !password || !password2) {
      // Mostrar mensaje de error
      setRegistrationMessage("Todos los campos son obligatorios.");
      return;
    }

    if (password !== password2) {
      setRegistrationMessage("Las contraseñas no coinciden.");
      return;
    }

    try {
      // Realizar el registro dentro de una función async
      const response = await (async () => {
        return dispatch(registerAuth(email, password));
      })();

      setRegistrationMessage("Usuario registrado exitosamente.");
    } catch (error) {
      if (error.code === "auth/email-already-in-use") {
        setRegistrationMessage("El correo electrónico ya está en uso.");
      } else {
        setRegistrationMessage("Error al registrar el usuario. Por favor, intenta nuevamente.");
      }
    }
    
  };

  return (
    <div className="registrase">
      <div className="container-registro-wrapper">
        <div className="container-registro">
          <img className="rectangle" alt="Rectangle" src={RegistroIMG} />
          <div className="text-wrapper">Registrarse</div>

          <div className="overlap">
            <label htmlFor="username" className="User"></label>
            <input type="text" id="username" name="username" placeholder="User34" onChange={onInputChange} value={username} />
          </div>

          <div className="overlap-group">
            <label htmlFor="email" className="User"></label>
            <input type="text" id="email" name="email" placeholder="User@gmail.com" onChange={onInputChange} value={email} />
          </div>

          <div className="text-wrapper-3">Nombre de usuario</div>
          <div className="text-wrapper-4">Email</div>
          <div className="text-wrapper-5">Contraseña</div>

          <div className="div-wrapper">
            <label htmlFor="password" className="password"></label>
            <input type="password" id="password" name="password" placeholder="********" onChange={onInputChange} value={password} />
          </div>

          <button type="submit" className="btn-registrarse" onClick={handleRegister}>
            <div className="overlap-group-2">
              <span className="text-wrapper-7">Registrarse</span>
              <div className="rectangle-2"></div>
            </div>
          </button>

            {/* Mostrar el mensaje de registro */}
            {registrationMessage && <div className="registration-message">{registrationMessage}</div>}

          <div className="text-wrapper-8">Confirmar Contraseña</div>

          <div className="overlap-2">
            <label htmlFor="password2" className="password"></label>
            <input type="password" id="password2" name="password2" placeholder="********" onChange={onInputChange} value={password2} />
          </div>
          
          {/* Resto del código... */}
        </div>
      </div>
    </div>
  );
};

export default Registro;
